(function ($, Drupal, iam) {
  "use strict";

  function switchNavLabel(loggedIn) {
    $('.cb-local-navigation ul > li > a[href="/"] > span').text(loggedIn ? 'My AP' : 'Home');
  }

  iam.getEventBus().addListener(iam.events.Login, function () {
    switchNavLabel(true);
  });

  iam.getEventBus().addListener(iam.events.Logout, function () {
    switchNavLabel(false);
  });

  Drupal.behaviors.myApWidget = {
    attach: function() {
      switchNavLabel(iam.getAuthSession().isLoggedIn);
    }
  };
})(jQuery, window.Drupal, window.cb.core.iam);
