/* global cb */
(function ($, drupalSettings) {
  'use strict';

  var appId = drupalSettings.cb.app_id;
  var programType = drupalSettings.cb.program;
  if (programType === 'higher-education') {
    programType = 'higher-ed';
  }
  var siteCode = drupalSettings.cb.site_code;
  var skipLocation = '#main-content';
  var searchType = drupalSettings.cb.global_header.search_type;
  var idp = drupalSettings.cb.global_header.idp;
  var title = drupalSettings.cb.global_header.title;
  var useSearchWidget = drupalSettings.cb.global_header.use_search_widget;
  var useLoginWidget = drupalSettings.cb.global_header.use_login_widget;
  var useGlyphLogo = drupalSettings.cb.global_header.use_glyph_logo;
  var useGlobalNavigation = drupalSettings.cb.global_header.use_global_nav;
  var loginRedirectUrl = drupalSettings.cb.global_header.redirectUrl;
  var destinationUrl = drupalSettings.cb.global_header.destinationUrl;

  var options = {
    appId: appId,
    idp: idp,
    destinationUrl: destinationUrl,
    siteCode: siteCode,
    programType: programType,
    title: title,
    skipLocation: skipLocation,
    useGlobalNavigation: useGlobalNavigation,
    useSearchWidget: useSearchWidget,
    useLoginWidget: useLoginWidget,
    useGlyphLogo: useGlyphLogo,
    searchConfig: {
      appId: appId,
      searchType: searchType,
      siteType: programType
    }
  };
  if (useLoginWidget && loginRedirectUrl) {
    options.identityConfig = {redirectUrl : loginRedirectUrl};
  }

  // Load the Global Header.
  window.cb.widgets.GlobalHeader.render('#global-header', options);
})(jQuery, drupalSettings);
